import styled from "styled-components";

export const Section = styled.section`
border:1px solid red;
width:80%;
margin:0 auto;
margin-top:60px;
`;
export const Title = styled.div`
border:1px solid red;
background-color:white;
text-align  :center;
padding:15px;
& h2{
  color: #000;
  text-transform:uppercase;
  font-size:36px;
  margin:0;
}
`;
export const Main = styled.div`
border:1px solid red;
display:flex;
`;
